import React from 'react';

const Container = () => {
  return  (
  <main role="main" className="inner cover container-color">
    <h1 className="cover-heading font-Neucha">DISCOVER THE COLORFUL WORLD</h1>
    <h1 className="font-the-girl">New Adventure</h1>
    <p className="lead font-Neucha">A social media to find tips & tricks to have a perfect vacation and qualify the places that you visit. </p>
    <p className="lead">
      <a href="register" className="btn btn-lg btn-outline-light font-Neucha">Get Started!</a>
    </p>
  </main>
    );
}

export default Container;
